pragma solidity ^0.4.4;

contract Idbox {

  event NewIdboxUserEvent(string phoneNumber, address cardPK, uint mineTime, uint blockNumber);

  struct IdboxUser {
    string phoneNumber;
    address cardPK;
    uint mineTime;
    uint blockNumber;
  }

  mapping (string => IdboxUser) private idboxUsersByPhoneNumber;
  mapping (address => string) private walletPkToPhoneNumber;

  function Idbox() public {
    // constructor
  }
  function addIdboxUser(string _userPhoneNumber, address _cardPK) public {
      IdboxUser memory newIdboxUser = IdboxUser(_userPhoneNumber, _cardPK, now, block.number);
      idboxUsersByPhoneNumber[_userPhoneNumber] = newIdboxUser;
      walletPkToPhoneNumber[_cardPK] = _userPhoneNumber;
      NewIdboxUserEvent(_userPhoneNumber, _cardPK, now, block.number);
  }
  function attachNewCard(string _userPhoneNumber, address _cardPK) public {
      idboxUsersByPhoneNumber[_userPhoneNumber].cardPK = _cardPK;
      walletPkToPhoneNumber[_cardPK] = _userPhoneNumber;
  }
  function findIdboxUserByPhoneNumber(string _userPhoneNumber) public constant returns(string, address, uint, uint) {
      return (idboxUsersByPhoneNumber[_userPhoneNumber].phoneNumber, idboxUsersByPhoneNumber[_userPhoneNumber].cardPK, idboxUsersByPhoneNumber[_userPhoneNumber].mineTime, idboxUsersByPhoneNumber[_userPhoneNumber].blockNumber);
  }
  function findIdboxUserByWalletPK(address _cardPK) public constant returns(string, address, uint, uint) {
      string memory phoneNumberFound =  walletPkToPhoneNumber[_cardPK];
      return (idboxUsersByPhoneNumber[phoneNumberFound].phoneNumber, idboxUsersByPhoneNumber[phoneNumberFound].cardPK, idboxUsersByPhoneNumber[phoneNumberFound].mineTime, idboxUsersByPhoneNumber[phoneNumberFound].blockNumber);
  }
}
